import './icon.scss';

interface IconProps {
    classNameAdded: string;
}

const Icon = ({ classNameAdded = '' }: IconProps): JSX.Element => {

    return (
        <div className={`icon ${classNameAdded}`}>
            <svg xmlns="http://www.w3.org/2000/svg" height="100%" width="100%" viewBox="0 0 360 100"
                preserveAspectRatio="xMinYMid meet">
                <text className="icon__text" x="0" y="82">Meijer</text>
                <rect className="icon__bar" x="0" y="44" width="360" height="7" />
            </svg>
        </div>
    );
}

export default Icon;
